import { utilService } from '../../../services/util.service.js'
import { storageService } from '../../../services/async-storage.service.js'

const NOTES_KEY = 'notesDB'
_createDemo()

export const noteService = {
     query,
     get,
     remove,
     save,
     addNote,
     duplicateNote,
     deleteTodo,
     addTodo,
     toggleTodos,
     togglePin,
     toggleTodoCheck,
     addImg,
     getEmptyNote,
     getEmptyTodo,
     deleteNote,
     restoreNote,
     exchangeNotes,
     exchangeTodos,
}

function query() {
     return storageService.query(NOTES_KEY)
          .then(notes => notes)
}

function get(noteId) {
     return storageService.get(NOTES_KEY, noteId)
}

function remove(noteId) {
     return storageService.remove(NOTES_KEY, noteId)
}

function save(note) {
     note.createdAt = Date.now()
     if (note.id) {
          return storageService.put(NOTES_KEY, note)
     } else {
          return storageService.post(NOTES_KEY, note)
     }
}

function addNote(note) {
     note.createdAt = Date.now()
     return save(note)
}

function duplicateNote(noteId) {
     return get(noteId)
          .then(note => {
               note.id = ''
               return save(note)
                    .then(savedNote => query())
          })
}

function deleteNote(noteId) {
     return get(noteId)
          .then(note => {
               note.isDeleted = true
               note.isPinned = false
               return save(note)
          })
}

function restoreNote(noteId) {
     return get(noteId)
          .then(note => {
               note.isDeleted = false
               return save(note)
          })
}

function exchangeNotes(exchangeInfo) {
     return query()
          .then(notes => {
               const { senderId, receiverId } = exchangeInfo
               const senderIdx = notes.findIndex(note => note.id === senderId)
               const receiverIdx = notes.findIndex(note => note.id === receiverId)
               if (notes[senderIdx].isPinned && !notes[receiverIdx].isPinned
                    || !notes[senderIdx].isPinned && notes[receiverIdx].isPinned) throw new Error('pin')
               notes[senderIdx].id = receiverId
               notes[receiverIdx].id = senderId
               return save(notes[senderIdx])
                    .then(updatedSender => {
                         return save(notes[receiverIdx])
                              .then(updatedReceiver => {
                                   return { senderIdx, updatedSender, receiverIdx, updatedReceiver }
                              })
                    })
          })
}

function exchangeTodos(exchangeInfo) {
     const { noteId, senderId, receiverId } = exchangeInfo
     return get(noteId)
          .then(note => {
               const todos = note.info.todos
               const senderIdx = todos.findIndex(todo => todo.id === senderId)
               const receiverIdx = todos.findIndex(todo => todo.id === receiverId)
               const originalSender = todos[senderIdx]
               note.info.todos[senderIdx] = todos[receiverIdx]
               note.info.todos[receiverIdx] = originalSender
               return save(note)
          })
}

function addTodo(noteId) {
     return get(noteId)
          .then(note => {
               note.info.todos.push({ txt: '', doneAt: null, id: utilService.makeId() })
               return save(note)
          })
}

function deleteTodo(noteId, todoId) {
     return get(noteId)
          .then(note => {
               const idx = note.info.todos.findIndex(todo => todo.id === todoId)
               note.info.todos.splice(idx, 1)
               return save(note)
          })
}

function toggleTodos(noteId) {
     return get(noteId)
          .then(note => {
               switch (note.type) {
                    case 'NoteTodos':
                         note.type = 'NoteTxt'
                         const todosMapped = note.info.todos.map((todo, idx) => {
                              if (idx !== note.info.todos.length - 1) return todo.txt + '\n'
                              return todo.txt
                         })
                         note.info.txt = todosMapped.join('')
                         break
                    case 'NoteTxt':
                         note.type = 'NoteTodos'
                         const todosSplitted = note.info.txt.split('\n')
                         note.info.todos = todosSplitted.map(todo => {
                              return { txt: todo, doneAt: null, id: utilService.makeId() }
                         })
                         break
               }
               return save(note)
          })
}
function togglePin(noteId) {
     return get(noteId)
          .then(note => {
               note.isPinned = !note.isPinned
               return save(note)
          })
}
function toggleTodoCheck(noteId, todoId) {
     return get(noteId)
          .then(note => {
               const currTodos = note.info.todos
               const idx = currTodos.findIndex(todo => todo.id === todoId)
               if (currTodos[idx].doneAt) currTodos[idx].doneAt = null
               else currTodos[idx].doneAt = Date.now()
               return save(note)
          })
}
function addImg(img, note) {
     note.type = 'NoteImg'
     note.info.url = img.src
     return save(note)
}

function getEmptyNote() {
     return {
          id: '',
          createdAt: null,
          type: 'NoteTxt',
          isPinned: false,
          isDeleted: false,
          style: { backgroundColor: '#ffffff' },
          info: { title: '', txt: '' }
     }
}

function getEmptyTodo() {
     return { txt: '', doneAt: null, id: utilService.makeId() }
}

function _createDemo() {
     let notes = utilService.loadFromStorage(NOTES_KEY)
     if (!notes || !notes.length) {
          notes = _demoNotes()
          utilService.saveToStorage(NOTES_KEY, notes)
     }
     return notes
}

